import { Grid, Items } from "./styles";

const Logs = () => {
  return (
    <>
      <Grid>
        <Items>
          <h3>Time</h3>
          <p>8:00 A.M</p>
        </Items>
        <Items>
          <h3>Cashier Name</h3>
          <p>Juan Dela Cruz</p>
        </Items>
        <Items>
            <></>Item Purchased

        </Items>
        <Items></Items>
      </Grid>
    </>
  );
};

export default Logs;
